import React from "react";
import FacebookIcon from '@material-ui/icons/Facebook';
import MailOutlineTwoToneIcon from '@material-ui/icons/MailOutlineTwoTone';
import PhoneTwoToneIcon from '@material-ui/icons/PhoneTwoTone'; 

const RouterContact = () => {
    return (
        <>
            <div className="container w-75 mt-5 py-5"  >
                <div className="row contactService">
                    <h1 className = "text-center text-capitalize display-3">Contact us for any Suggestions or queries</h1>
                    
                    <div className="col-md-4 col-12 py-3 text-center" >
                        <button type="button" className="btn btn-lg btn-outline-success">contact us +91 <PhoneTwoToneIcon/></button>
                    </div>
                    <div className="col-md-4 col-12  py-3 text-center" >
                        <button type="button" className="btn btn-lg btn-outline-primary">contact us on <FacebookIcon/></button>
                    </div>
                    <div className="col-md-4 col-12  py-3 text-center" >
                        <button type="button" className="btn btn-lg btn-outline-danger">E-mail Us <MailOutlineTwoToneIcon/></button>
                    </div>

                </div>
            </div>
        </>
    );
}

export default RouterContact;
